import React from "react";
import Myauto from "./myauto";
import Header from "./header";
import Navbar from "./navbar";
import Main from "./main";
import data4 from "./data4.json";
import Filter from "./Filter";
import { useState } from "react";
import "./App1.css";
import "./App.css";

function App() {
  let IDs: number[] = [
    91350842, 92060138, 91347734, 92836546, 92835750, 86946439, 85990507,
    92792538,
  ];
  const items: object[] = data4.data.items;

  const [currency, setCurrency] = useState<string>("GEL");

  const selectCurrency = (currency: string) => {
    setCurrency(currency);
  };

  return (
    <>
      <Header />
      <Myauto />
      <Filter selectCurrency={selectCurrency} currency={currency} />
      <Navbar />
      <Main IDs={IDs} selectCurrency={selectCurrency} currency={currency} />
    </>
  );
}

export default App;
